import React from "react";
import "date-fns";
import {
  Paper,
  Box,
  Typography,
  Divider,
  Container,
  InputLabel,
  Select,
  FormControl,
  FormHelperText,
  MenuItem,
  Grid,
  Button,
} from "@material-ui/core";
import { Table, TextField, CircularProgress } from "@material-ui/core";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TablePagination from "@material-ui/core/TablePagination";
import TableRow from "@material-ui/core/TableRow";
import TableSortLabel from "@material-ui/core/TableSortLabel";
import Toolbar from "@material-ui/core/Toolbar";
import { connect } from "react-redux";
import { ThemeProvider } from "@material-ui/core/styles";
import { theme } from "../../theme/light";
import { withStyles } from "@material-ui/core/styles";
import DateFnsUtils from "@date-io/date-fns";
import {
  MuiPickersUtilsProvider,
  KeyboardTimePicker,
  KeyboardDatePicker,
} from "@material-ui/pickers";
import UserService from "../../services/user.service";
import moment from "moment";

const useStyles = (theme) => ({
  root: {
    "& > *": {
      marginTop: theme.spacing(4),
    },
  },
  paper: {
    width: "100%",
  },

  formControl: {
    marginTop: theme.spacing(2),
    minWidth: 300,
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
});

const headCells = [
  { id: "name", numeric: false, disablePadding: false, label: " Name" },
  {
    id: "emailAddress",
    numeric: false,
    disablePadding: false,
    label: "Mobile Number",
  },
  { id: "mobileNumber", numeric: false, disablePadding: false, label: "city" },
  { id: "city", numeric: false, disablePadding: false, label: "Email" },
  {
    id: "description",
    numeric: false,
    disablePadding: false,
    label: "Description",
  },
];

class Home extends React.PureComponent {
  constructor(props) {
    super(props);
    this.state = {
      age: "",
      startDate: new Date(),
      endDate: new Date() + 1,
      deviceuniqueid: "Web",
      token: "339CFB64EDC6E94C5577CD68319E72AB6732C711AE661427AC83931B33F05CC4",
      mappingList: [],
      consolidates: "",
      type: "",
      facilityid: "",
    };
  }

  componentDidMount() {
    const { userDetails } = this.props;
    const { loginToken } = userDetails;
    this.setState(
      {
        token: loginToken,
        facilityid: "34",
      },
      () => {
        this.getRefreshMapping();
        this.getDailyAdminParkingStatusReport(new Date());
      }
    );
  }

  getRefreshMapping = async () => {
    const { deviceuniqueid, token } = this.state;

    try {
      const response = await UserService.mapping(deviceuniqueid, token);
      const { status, data } = response;
      const { groupmapping } = data;
      const { data: list } = groupmapping;
      console.log("response after getRefreshMapping --> ", response);
      if (data && list.length > 0) {
        let id = [];
        list.map((item, index) => {
          id.push(item.instanceid);
        });
        id = id.join(",");
        this.setState({
          mappingList: list,
          consolidates: id,
        });
      }
    } catch (error) {
      console.log("error getRefreshMapping", error);
    }
  };

  getDailyAdminParkingStatusReport = async (inputdate) => {
    const { token, facilityid } = this.state;
    let inputdatetime = moment(inputdate).format("DD-MMM-YYYY"); // 01-Oct-2022

    try {
      const response = await UserService.AdminParkingStatusReport(
        facilityid,
        token,
        "01-Oct-2022"
      );

      console.log("response after getDailyAdminParkingStatusReport ", response);
      const { data: res } = response;
      if (res.respCode === 1 && res) {
        const { checkin, checkout, payment } = res;

        let totalcheckin = 0;
        let totalcheckout = 0;
        let totalPayment = 0;
        let totalVehicle = 0;
        let carIn = 0;
        let carOut = 0;
        let bikeIn = 0;
        let bikeOut = 0;
        let bicycleIn = 0;
        let bicycleOut = 0;
        let autoIn = 0;
        let autoOut = 0;
        let cashCount = 0;
        let onlineCount = 0;
        let noCashCount = 0;

        let vehicleArray = [];
        const vechicles = {
          1: "Bike",
          2: "Car",
          3: "Auto",
          4: "Bicycle",
        };
        if (checkin) {
          for (let i = 0; i < checkin.length; i++) {
            const { vehicletype, vehiclecount } = checkin[i];
            const vehicleName = vechicles[vehicletype];
            const ifExist = vehicleArray.findIndex(
              (value, index) => value === vehicleName
            );
            if (ifExist == -1) {
              vehicleArray.push(vehicleName);
            }

            carIn = vehicleName == "Car" ? vehiclecount : carIn;
            bikeIn = vehicleName == "Bike" ? vehiclecount : bikeIn;
            bicycleIn = vehicleName == "Bicycle" ? vehiclecount : bicycleIn;
            autoIn = vehicleName == "Auto" ? vehiclecount : autoIn;

            totalcheckin = totalcheckin + vehiclecount;
          }
          console.log("checkin data", carIn);
        }
      }
    } catch (error) {
      console.log("error getDailyAdminParkingStatusReport", error);
    }
  };

  handleChange = (event) => {
    this.setState({
      age: event.target.value,
    });
  };

  handleTypeChange = (event) => {
    this.setState({
      type: event.target.value,
    });
  };

  handleDateChange = (date) => {
    console.log(date);
    this.setState({
      startDate: date,
      endDate: date + 1,
    });
  };
  handleEndDateChange = (date) => {
    this.setState({
      endDate: date,
    });
  };
  render() {
    const { classes } = this.props;
    const { age, startDate, endDate, mappingList, type } = this.state;
    console.log("mappingList", mappingList, " type", type);
    return (
      <ThemeProvider theme={theme}>
        <Box className="container" p={2.5} bgcolor="primary.lightBgContainer">
          <Paper className="content lead-page">
            <Box className="page-heading" mb={3}>
              <Box color="text.secondary" pt={3} pr={2.7} pb={1.8} pl={3}>
                <Typography variant="h6" gutterBottom color="inherit">
                  Dashboard
                </Typography>
              </Box>
              <Divider />
            </Box>
            <MuiPickersUtilsProvider utils={DateFnsUtils}>
              <Grid container justifyContent="space-evenly">
                <FormControl variant="standard" className={classes.formControl}>
                  <InputLabel htmlFor="age-native-simple">
                    Select Faciliy
                  </InputLabel>
                  <Select
                    native
                    value={age}
                    placeholder={"Age"}
                    onChange={(e) => this.handleChange(e)}
                  >
                    <option value="0">Consolidated</option>

                    {mappingList.map((data, index) => {
                      return (
                        <option key={index.toString()} value={data.instanceid}>
                          {data.name}
                        </option>
                      );
                    })}
                  </Select>
                </FormControl>
                <FormControl variant="standard" className={classes.formControl}>
                  <InputLabel htmlFor="age-native-simple">
                    Select Type
                  </InputLabel>
                  <Select
                    native
                    value={type}
                    placeholder={"Age"}
                    onChange={(e) => this.handleTypeChange(e)}
                  >
                    <option aria-label="None" value="NA" />
                    <option value={"Daily"}>Daily</option>
                    <option value={"Monthly"}>Monthly</option>
                  </Select>
                </FormControl>

                <KeyboardDatePicker
                  disableToolbar
                  variant="inline"
                  format="dd/MM/yyyy"
                  margin="normal"
                  id="date-picker-inline"
                  label="Date"
                  value={
                    "Sat Oct 01 2022 00:37:00 GMT+0530 (India Standard Time)"
                  }
                  onChange={(date) => this.handleDateChange(date)}
                  KeyboardButtonProps={{
                    "aria-label": "change date",
                  }}
                />
                {/* <KeyboardDatePicker
                  disableToolbar
                  variant="inline"
                  format="dd/MM/yyyy"
                  margin="normal"
                  id="date-picker-inline"
                  label="End Date"
                  minDate={startDate}
                  value={endDate}
                  onChange={(date) => this.handleEndDateChange(date)}
                  KeyboardButtonProps={{
                    "aria-label": "change date",
                  }}
                /> */}
                <div className={classes.root}>
                  <Button variant="contained" size="small" color="primary">
                    Submit
                  </Button>
                </div>
              </Grid>
            </MuiPickersUtilsProvider>

            <div className="data-table">
              <div className={classes.root}>
                <Paper className={classes.paper} elevation={0}>
                  <TableContainer>
                    <Table
                      className={classes.table}
                      aria-labelledby="tableTitle"
                      aria-label="enhanced table"
                    >
                      <EnhancedTableHead
                        classes={classes}
                        numSelected={selected.length}
                        order={order}
                        orderBy={orderBy}
                        onSelectAllClick={this.handleSelectAllClick}
                        onRequestSort={this.handleRequestSort}
                        rowCount={rows.length}
                      />
                      <TableBody>
                        {stableSort(rows, getComparator(order, orderBy))
                          .slice(
                            page * rowsPerPage,
                            page * rowsPerPage + rowsPerPage
                          )
                          .map((Lead, index) => {
                            const isItemSelected = isSelected(Lead.id);
                            const labelId = `enhanced-table-checkbox-${index}`;

                            return (
                              <TableRow
                                hover
                                // onClick={(event) =>
                                //   this.handleClick(event, Lead.id)
                                // }
                                //role="checkbox"
                                //aria-checked={isItemSelected}
                                tabIndex={-1}
                                key={index}
                                selected={isItemSelected}
                              >
                                {/* <TableCell padding="checkbox">
                                  <Checkbox
                                    checked={isItemSelected}
                                    inputProps={{ "aria-labelledby": labelId }}
                                  />
                                </TableCell> */}
                                <TableCell
                                  component="th"
                                  id={labelId}
                                  scope="row"
                                  padding="none"
                                >
                                  {Lead.name}
                                </TableCell>
                                <TableCell align="left">
                                  {Lead.emailAddress}
                                </TableCell>
                                <TableCell align="left">
                                  {Lead.mobileNumber}
                                </TableCell>
                                <TableCell align="left">{Lead.city}</TableCell>
                                <TableCell align="left">
                                  {Lead.description}
                                </TableCell>
                              </TableRow>
                            );
                          })}
                        {emptyRows > 0 && (
                          <TableRow>
                            <TableCell colSpan={6} />
                          </TableRow>
                        )}
                      </TableBody>
                    </Table>
                  </TableContainer>
                  <TablePagination
                    rowsPerPageOptions={[10, 50, 100]}
                    component="div"
                    count={allBranch.length}
                    rowsPerPage={rowsPerPage}
                    page={page}
                    onPageChange={this.handleChangePage}
                    onRowsPerPageChange={this.handleChangeRowsPerPage}
                  />
                </Paper>
              </div>
            </div>
          </Paper>
        </Box>
      </ThemeProvider>
    );
  }
}

const mapStateToProps = (state) => ({
  userDetails: state.user,
});

export default connect(mapStateToProps)(withStyles(useStyles)(Home));
